import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Home from './Home';

function App() {
   return (
    <div>
      <BrowserRouter>
      <Routes>
        <Route>
        <Home/>
        </Route>
      </Routes>
      </BrowserRouter>
        <Home/>
     </div>
   );
 }

export default App;
